class Utility {
    get anchor()
    {
        let size=browser.getWindowSize();
        const anchorPercentage=50;
        const startPointPercentage=90;
        const endPointPercentage=10;
        const anchor=size*anchorPercentage/100;
        const endPoint=size*endPointPercentage/100;
        const startPoint=size*startPointPercentage/100;
        this.swipeTillElement(anchor,startPoint,endPoint);
    }
    async swipeTillElement(anchor, startPoint, endPoint) {
      await  driver.touchPerform([
            {
                action: 'press',

                options: {

                    x: anchor,

                    y: startPoint

                },

            },

            {

                action: 'wait',

                options: {

                    ms: 2000

                },

            },

            {

                action: 'moveTo',

                options: {

                    x: anchor,

                    y: endPoint

                },

            },

            {

                action: 'release',

                options: {}

            },

        ])

    }
}
module.exports=Utility;

