        try {
            browser.acceptAlert();
        }
        catch (e) {
            AllureReporter.addStep('Unable to click on accept on alert');
        }
    }
    async dismissAlert() {
        try {
            browser.dismissAlert();
        }
        catch (e) {
            AllureReporter.addStep('Unable to click dismiss on alert');
        }
    }
    async keyboardActions(inputKey) {
        browser.keys(Key.inputKey);
    }
    async tapElement(element, XOffset, YOffset, noOfTouches) {
        await driver.touchPerform([
            {
                action: 'tap',
                options:
                {
                    element: element,
                    x: XOffset,
                    y: YOffset,
                    count: noOfTouches
                }
            }

        ]);
