        await browser.pause(3000);
        expect(await ORObj.getPageHeaderText()).toHaveText(constants.HOMEPAGE_TITLE);
        await ORObj.clickOnSideMenu();
        await ORObj.clickOnLinkOnSideMenu(constants.HOMEPAGE_LINK);
